public class NumericalValues {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		System.out.println(5%3);
		int ex1 = 11;
		int ex2 = ex1 + 3;
		System.out.println(ex2);
		int q = 5;
		int r = 2 + q++;
		System.out.println(r);
		int s = q++ + 2;
		System.out.println(s);
	}

}
